  false,\n\t\"url\": null,\n\t\"notes\": \"The Comprehensive Environmental Response,
  Compensation, and Liability Act (CERCLA), commonly known as Superfund, provides
  a federal \"superfund\" to clean up uncontrolled or abandoned hazardous-waste sites
  as well as accidents, spills, and other emergency releases of pollutants and contaminants
  into the environment. Through CERCLA, the U.S. Environmental Protection Agency (EPA)
  was given power to seek out those parties responsible for any release of pollutants
  and contaminants, and assure their cooperation in the cleanup. EPA cleans up orphan
  sites when potentially responsible parties cannot be identified or located, or when
  they fail to act. EPA is authorized to implement CERCLA in all 50 states and U.S.
  territories. Superfund site identification, monitoring, and response activities
  in states are coordinated through the state environmental protection or waste management
  agencies. + Source: http://www.epa.gov/lawregs/laws/cercla.html + Date Enacted:
  December 11, 1980 + Codification: 42 U.S.C. Section 9601 et seq. + Authority: U.S.
  Environmental Protection Agency\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
